-- ----------------------------
-- Table structure for resume
-- ----------------------------
DROP TABLE IF EXISTS `resume`;
CREATE TABLE `resume`  (
  `reid` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `origin` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '籍贯',
  `politicalLandscape` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '政治面貌',
  `graduationTime` date NULL DEFAULT NULL COMMENT '毕业时间',
  `workplace` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '求职地点',
  `occupation` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '职业',
  `workTime` int(11) NULL DEFAULT NULL COMMENT '工作年限（/年）',
  `educationalExperience` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '教育经历，教育时间，教育院校，教育描述。教育描述，可填写平均成绩、某些课程列举、毕业设计等',
  `internshipExperience` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '实习时间，实习项目，实习描述。实习描述，可填写主要职责范围、工作任务、取得的成绩等',
  `award` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '获奖时间，奖励名称。奖励名称这里可填写奖项的级别、颁奖机构、奖项所体现的成绩等。所获奖励一般要求是奖学金或者其他国际性，全国性及省级的竞赛的得奖。如果是小社团的一些竞赛成果可以忽略不写。',
  `skillCertificate` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '技能证书需要填写的内容包括：获取时间，证书名称。',
  `professionalSkills` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '专业技能需要填写技能描述，可填写语言能力，其他特长等。',
  `selfEvaluation` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '自我评价也叫做自我介绍，可填写应聘某岗位的最大优势等简练的语句。自我评价是很个人简历中重要的一个内容，也是绝大部分面试不可或缺的一部分。在进行自我评价时，要注意口语化，不要书面化或者行政化。并且要切中要害，条理清晰，层次分明。',
  `recommend` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '第三方推荐。可附加在个人简历上作为推荐信。第三方推荐是通过专业的职业测评系统，出具详细客观的测评报告，作为第三方推荐信，附在简历后面作为求职推荐的形式。一方面说明求职者的职业性格、职业兴趣，另一方面有利于用人单位判断求职者与岗位的匹配情况。',
  `pic` longblob NULL COMMENT '封面？附件？此选项保留',
  PRIMARY KEY (`reid`) USING BTREE,
  INDEX `RESUME_USER_FK`(`uid`) USING BTREE,
  CONSTRAINT `RESUME_USER_FK` FOREIGN KEY (`uid`) REFERENCES `user` (`uid`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = DYNAMIC;

